import React from 'react';
import ListWrapper from './assets/components/ListWrapper/ListWrapper';
import "./index.css";
import MyComponent from './assets/components/MyComponent/MyComponent';

const App = () => (
    <div>
        <MyComponent />
        <ListWrapper />
    </div>
);

export default App;
